INSERT INTO `albistea` VALUES (1,'OSTIRAL HONETAN ARETAKO PILOTALEKUAN E.H-ko ELITE 4 ½ TXAPELKETAKO FINALA JOKATUKO DA','Ostiral honetan arratsaldeko 19:15etan hasita E.H-ko Elite 4 ½ txapelketako finala jokatuko da Aretako pilotalekuan.','Oier Hormaetxek (LEZAMA) edizio honetako pilotari gazteenak eta Gaizka Carregalek (ADISKIDE) bizkaitarrek jokatuko dute bizkaitarrentzat derbi kutsua duen final handia ostiral honetan. Bi pilotariak txapelketa bikaina eginda iritsi dira finalera, finalerdietan sekulako partidak jokatuta. Hormaetxek 13-22 irabazi zion finalerdia txapelketa aurreko edizioko azpitzapeldunari (Igoa) eta Carregalek 22-18 azken edizioko txapeldunari (Canabal). Aurtengo finala oso irekia dago bi pilotariak oso joko puntu onean iristen baitira. Oier Hormaetxek erakutsi du maila honetako txapelketak eta partiduak jokatzeko guztiz prest dagoela eta nola ez Gaizka Carregal, azkeneko denboraldietako aurrelari finetarikoa izan denak. Hormaetxe oso erasokorra da eta Carregal berriz defentsa eta fisiko gaitasun ikaragarriek dituena, hori dela eta, oso partida bizia eta ikusgarria ikustea espero da. Finala jokatu aurretik Herriaren Pilota Elkarteak antolatzen duen Aretako txapelketako nagusi mailako bikotekako partida bat jokatuko da. Bertan Zubizarreta-Garmendia vs Amiano-Aizpuru lehiatuko dira. ','','2017-02-03','10:20:00','Jokin Petisko','Lehiaketa'),(2,'ASTEBURU HONETAN JOKATUKO DA ITSASUN E.H-ko BOTE LUZEA FASE FINALA','Larunbat honetan goizeko 10:00etan hasita, Itsasuko Elizaldeko Pentsean zelaian jokatuko dira 2020ko E.H-ko Bote Luzea txapelketako finalerdiak eta finala.','Larunbat honetan goizeko 10:00etan hasita, Itsasuko Elizaldeko Pentsean zelaian jokatuko dira 2020ko E.H-ko Bote Luzea txapelketako finalerdiak eta finala.','','2022-03-05','09:14:15','Andoni Fernadez','Lehiaketa'),(3,'E.H-ko ELITE 4 ½ TXAPELKETAKO FINAL LAURDEN BIKOITZA ASTEBURU HONETAN ARETAKO PILOTALEKUAN','Ostiral honetan arratsaldeko 19:00etan hasita E.H-ko Elite 4 ½ txapelketako final laurdenen bi norgehiagoka jokatuko dira Aretako pilotalekuan.','Lehendabiziko partiduan aurreko urteko txapelduna den Iraitz Zubizarreta (L.A.P.K.E) Eneko Maiz (Behar Zana) Gipuzkoako 4 1/2ko txapeldunaren aurka lehiatuko da. Oso partidu interesgarria aurreikusten da eta nahiz eta Zubizarreta faborito izan Maizek esperientzia handia du txapelketa garrantzitsuetan eta aurkari benetan zaila izango da Zubizarretarentzat. Partidu hau irabazten duenak Xabier Iribarren Txukun Lakua klubeko pilotaria izango du aurkari azaroaren 22ko lehen finalerdian. Bigarren partidua Adiskide klubeko Gaizka Karregalek eta Behar Zanako Jon Urbietak jokatuko dute. Norgehiagoka hau parekatuagoa aurreiskusten da eta garaipena lortzen duenak hurrengo asteko azken final laurdena nork irabazten duen itxaron beharko du finalerdietako aurkaria ezagutzeko. ','','2017-04-02','11:23:00','Ander Gomez','Lehiaketa'),(4,'OSTIRALEAN HASIKO DA ARETAN 2018ko EUSKADIKO 4 ½-ko ELITE TXAPELKETA','Bost astetan zehar “kaiolako” Euskal Herriko 8 pilotari oberenak lehiatuko dira Aretako pilotalekuan.','Ostiral honetan 19:30etatik aurrera, Zazpi Iturri klubeko derbyarekin emango zaio hasiera txapelketari. Aurreko urteko txapelduna den Zubiriak I. Egiguren taldekidea menderatu beharko du finalerdietako txartela lortu nahi badu.','','2017-05-14','17:04:00','Xuban Garcia','Lehiaketa'),(5,'FINALEZ BETETAKO BESTE ASTEBURU BAT','Asteburu honetan jokatuko dira Zumaia, Irun, Gasteiz eta Mallabian Trinketeko Kluben, Irekia eta Zesta Puntako E.H-ko Herriarteko txapelketen finalak.','Aurtengo denboraldi arraroa bere bukaerara iristen ari da. Aurreko asteburuetan ezker paretako finalak jokatu eta gero asteburu honetan trinketeko kluben artekoari, Irekia txapelketari eta Zesta Puntako E.H-ko Herriartekoari tokatzen zaie. ','','2022-03-25','12:12:00','Ander Bravo','Lehiaketa');
